namespace ClickerHeroesTrackerWebsite.Tests.Models
{
    using ClickerHeroesTrackerWebsite.Models.SaveData;
    using ClickerHeroesTrackerWebsite.Models.Simulation;
    using Microsoft.VisualStudio.TestTools.UnitTesting;
    using Mocks;

    [TestClass]
    public class SimulationTests
    {
        [TestMethod]
        public void Simulation_0()
        {
            const string SaveData = "";
            Validate(SaveData, 2005, 1801.376, 556452.089, 308.904);
        }

        [TestMethod]
        public void Simulation_17229()
        {
            const string SaveData = "";
            Validate(SaveData, 2910, 794.662, 6226145.941, 7834.960);
        }

        [TestMethod]
        public void Simulation_18395()
        {
            const string SaveData = "";
            Validate(SaveData, 2505, 1534.966, 3001604.946, 1955.487);
        }

        [TestMethod]
        public void Simulation_19539()
        {
            const string SaveData = "";
            Validate(SaveData, 2300, 1696.960, 1527951.633, 900.405);
        }

        [TestMethod]
        public void Simulation_21533()
        {
            const string SaveData = "";
            Validate(SaveData, 1110, 2772.585, 45393.164, 16.372);
        }

        [TestMethod]
        public void Simulation_OddLength()
        {
            // Length of the substring on the left side of the anti-cheat code is a odd number.
            const string SaveData = "";
            var decodedSaveData = SavedGame.DecodeSaveData(SaveData);
            Assert.IsNull(decodedSaveData);
        }

        private static void Validate(string encodedSaveData, double level, double time, double souls, double ratio)
        {
            var decodedSaveData = SavedGame.DecodeSaveData(encodedSaveData);
            var saveData = SavedGame.DeserializeSavedGame(decodedSaveData);
            var simulationResult = new Simulation(
                MockGameData.RealData,
                saveData,
                null).Run();

            Assert.IsNotNull(simulationResult);

            const double Delta = 0.001;
            Assert.AreEqual(level, simulationResult.Level, Delta);
            Assert.AreEqual(time, simulationResult.Time, Delta);
            Assert.AreEqual(souls, simulationResult.Souls, Delta);
            Assert.AreEqual(ratio, simulationResult.Ratio, Delta);
        }
    }
}
